                <div>
                    <input class="login_btn" type="submit" value="로그인" />
                </div>
            </form>
            <div class="login_bottom">
                <a href="">아이디 찾기</a> | <a href="">비밀번호 찾기</a> |{" "}
                <a href=""> 회원 가입</a>
            </div>
        </div>
    </>
    );
}

export default LoginForm;
